import phonefriend from '../img/phonefriend.png';
import cookfood from '../img/cookfood.png';
import music from '../img/music.png';


class ImageResults extends Component {

  getStyle= ()=> {
    return {
    padding: '20px',
    maxheight:'50 px',
    maxWidth: '50 px'
    }
}

  renderImages() {
    // let images =[music]
    // let imageTitle= ['music']

    let images = [music,wringtowel,workout,wildcard,takewalk,takebreather,punchpillow,phonefriend,cookfood];
  let imageTitle= ['Music','Wring Towel','Workout','Wild Card','Take Walk','Take Breather','Punch Pillow','Phone Friend','Cook Food'];

   let imagesTiles = [];
   for (let i=0; i<images.length;i++){
      imagesTiles.push(

        <GridTile
        key= {images[i]}
        title={imageTitle[i]}
        >
          <img style={this.getStyle()} src={images[i]} alt={imageTitle[i]}/>
        </GridTile>)
    }
    return imagesTiles;
  }

render(){

  let imageListContent =(
    <GridList cols={3}>

    {this.renderImages()}
  </GridList>

  )


  // render() {
