    // if(images){
    //     imageListContent = (

    //     )
    // }else{
    //     imageListContent =  ["music"];
    // }   

    return (


      <div style={{"margin":"20px"}}>
        {imageListContent }
      </div>

      // <div>
      //   {this.renderImages()}
      // </div>
    )
  }
}



ImageResults.propTypes={
    images: PropTypes.array.isRequired
}
export default ImageResults;
